import styled from "styled-components";


export const SearchBarStyle = styled.div`


.search {
    display: flex;
    margin-top: 50px;
        & svg {
            font-size: 45px;
            margin-left: 50px;
            cursor: pointer;
            color: #00FF7F;
        }    
}


input {
    margin-left 35%;
    margin-top: 0px;
    margin-bottom: 75px;

    width: 350px;
    height: 40px;
    padding-left: 10px;
}

p {
    margin: 0;
    color: #ffff;
    font-weight: 450;
}

`
